class Solution(object):
    def countPalindromicSubsequence(self, s):
        """
        :type s: str
        :rtype: int
        """
        # pre-process
        L = len(s)
        C = 26
        presum = [[0] * C for _ in range(L + 1)]

        for x in range(L):
            for c in range(C):
                if c == ord(s[x]) - ord('a'):
                    presum[x + 1][c] = presum[x][c] + 1
                else:
                    presum[x + 1][c] = presum[x][c]
        # print(presum)

        # process
        palindromes = set()
        for x in range(1, L - 1):
            for c in range(C):
                if presum[x][c] > 0 and presum[-1][c] - presum[x + 1][c] > 0:
                    ch = chr(ord('a') + c)
                    palindrome = "{}{}{}".format(ch, s[x], ch)
                    palindromes.add(palindrome)
        ans = len(palindromes)
        return ans


